    <div id="outer">

            <div class="border-radius px-5 py-4 mb-4 bg-image">
                <div class="row h-100">
                    <p class="subtitle-activity text-start">Roll the dice and choose the correct answer.</p>
                    <div class="w-100 h-100 p-3 row cross-center box">

                                            <span class="dot"></span>

                                            <span class="dot"></span>
                                            <span class="dot"></span>

                                    </div>

                                    <div class="cube-face right">
                                        <div class="inside">
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                        </div>
                                    </div>

                                    <div class="cube-face top">
                                        <div class="inside">
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                        </div>
                                    </div>

                                    <div class="cube-face bottom">
                                        <div class="inside">
                                            <span class="dot"></span>
                                            <span class="dot"></span>
                                        </div>
                                    </div>
                                </div>
                            </div>

                            <button id="button-roll" onclick="lanzardado()" class="fs-5 px-4 bg-warning cursor-pointer text-animate boton-presionado container-port border-0">
